import React, { Component } from 'react';
import {Link, link} from 'react-router-dom';
import logo from '../'

export default class Navbar extends Component {
    render() {
        return (
            <nav className="navbar navbar-expand-sm navbar-dark px-sm-5" >
                <Link to='/'>
                    <img src="" alt="logo"/>
                </Link>
            </nav>
        )
    }
}
